import React from 'react';
import './test.css';

class Homepage extends React.Component{

  render() {
    return <div>
        <h2>Welcome to Twitter 
          <span> 
            <img src="https://www.clipartmax.com/png/middle/51-514066_file-history-angry-bird-the-movie-red.png" alt="red angry bird" width="500" height="333"/>
          </span>
        </h2>
    </div>
  }

}

export default Homepage;
